#include <stdio.h>
#include <stdlib.h>

typedef struct Node {
    int key;
    struct Node* left;
    struct Node* right;
    struct Node* parent;
} Node;

Node* root = NULL;

void insert(int key) {
    Node* z = (Node*)malloc(sizeof(Node));
    z->key = key;
    z->left = NULL;
    z->right = NULL;
    z->parent = NULL;

    Node* y = NULL;
    Node* x = root;

    while (x != NULL) {
        y = x;
        if (z->key < x->key) {
            x = x->left;
        } else {
            x = x->right;
        }
    }

    z->parent = y;

    if (y == NULL) {
        root = z;
    } else if (z->key < y->key) {
        y->left = z;
    } else {
        y->right = z;
    }
}

void inorder(Node* node, int* keys, int* index) {
    if (node != NULL) {
        inorder(node->left, keys, index);
        keys[*index] = node->key;
        (*index)++;
        inorder(node->right, keys, index);
    }
}

void preorder(Node* node, int* keys, int* index) {
    if (node != NULL) {
        keys[*index] = node->key;
        (*index)++;
        preorder(node->left, keys, index);
        preorder(node->right, keys, index);
    }
}

